  "messages": [
    {
      "role": "user",
      "content": "You are given the following text:

{{ $json.data }}

Analyze the text and generate a hierarchical JSON array representing the concepts mentioned. Use the following structure for each item:
json
{ 'id': string, 'Label': string, 'parentId'?: string }

Each concept or subtopic should be represented as a node.
Assign a unique 'id' to each node.
Use 'Label' to represent the name/title of the node and dont make sure the titles not too long.
If the node is a subtopic of another, set its 'parentId' to the 'id' of the parent node.
The resulting structure should reflect the conceptual hierarchy present in the input text.
Output only the JSON array.
Example Output Format:
json
[
 { 'id': '1', 'Label': 'Smart Home System' },
 { 'id': '2', 'Label': 'Key Benefits', 'parentId': '1' },
 { 'id': '3', 'Label': 'Energy Efficiency', 'parentId': '2' }
]
 , make sure the format is correct"
    }
  ]
}

