let text = $input.first().json.data;

let data = text.substring(1 , text.length - 1);

return {data}

return [
  {
    json: {
      summary: $input.first().json.summary,
      flashcards: JSON.parse($input.first().json.flashcard),
      mindmap:JSON.parse($input.first().json.mindmap),
      pdfName:  $input.first().json.pdfName,
      userId: $input.first().json.userId,
      pdfUrl: $input.first().json.pdfUrl
    }
  }
];

